import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from 'react';
import { Jumbotron, Navbar, NavbarBrand, NavbarToggler, Collapse, Nav, NavItem, NavLink, Container } from 'reactstrap';
import Head from 'next/head';

function HomePage() {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return (
        <div>
            <Head></Head>
            <Navbar color="dark" dark expand="md">
                <Container>
                    <NavbarBrand href="/">Site</NavbarBrand>
                    <NavbarToggler onClick={toggle} />
                    <Collapse isOpen={isOpen} navbar>
                        <Nav className="mr-auto" navbar>
                            <NavItem>
                                <NavLink href="/">Sair</NavLink>
                            </NavItem>
                        </Nav>
                    </Collapse>
                </Container>
            </Navbar>
            <Jumbotron>
                <h1 className="text-center">Welcome to Site!</h1>
            </Jumbotron>
        </div>
    )
}

export default HomePage
